import it from './listItems.module.css'




function Listitem({ todos, onChange, Removed }) {




    return (

        <div className={it.mapValue} >

            {todos.map((todo) => {
                return (

                    <div className={it.todo_item} key={todo.id}>
                        <div className={it.leftItem}>
                            <input id={todo.id} className={it.checkbox} type="checkbox"
                                checked={todo.isCompleted} onChange={() => {
                                    onChange({
                                        ...todo,
                                        isCompleted: !todo.isCompleted
                                    })
                                }}
                            />
                            <label className={it.check} htmlFor={todo.id}></label>
                            <label htmlFor={todo.id}>
                                {
                                    todo.isCompleted ?
                                    <i><s>{todo.text}</s></i> :<>{todo.text}</>
                                }

                            </label>

                        </div>
                        <div className={it.removeBut} onClick={() => {
                            Removed(todo.id)
                        }}><p className={it.remove} >x</p></div>

                    </div>
                )
            })}
        </div>
    )
}
export default Listitem
